def _get_with(self, key):
    if isinstance(key, slice):
        slobj = self.index._convert_slice_indexer(key, kind="getitem")
        return self._slice(slobj)
    elif isinstance(key, (tuple, list, np.ndarray, ExtensionArray, Index)):
        if isinstance(key, Index):
            key_type = key.inferred_type
        else:
            key_type = lib.infer_dtype(key, skipna=False)

        if key_type == "integer":
            if not self.index._should_fallback_to_positional():
                return self.loc[key]
            else:
                return self.iloc[key]

        elif key_type == "boolean":
            # com.is_bool_indexer check in __getitem__ should handle this case
            raise TypeError("Boolean indexing is not supported")

        elif isinstance(key, list):
            return self.loc[key]

        else:
            return self.reindex(key)

    else:
        # handle other cases, e.g. scalars
        return self.loc[key]
